    "yrkesbeskrivning": "Hovmästare organiserar och leder serveringspersonals arbete. Tar emot bordsreservationer samt beställningar på mat och dryck på restauranger eller hotell. Ansvarar för drycker på en restaurang.\n\nBartendrar serverar drycker på restauranger, hotell, nattklubbar, diskotek eller pubar. Lämnar ut drycker till serveringspersonal efter gästers beställningar. Tillreder och serverar kaffebaserade drycker på kaféer och konditorier.\n\nTexten för delade yrkesgrupper avser endast ovanstående yrken.",
