    "yrkesomrade": "Förundransvärda yrken",
    "kritiskFaktor": "Förmåga att kunna kombinera fysisk ansträngning och upprätthålla engagemang för ett säljande arbete är avgörande krav.",
    "relateradeICFKoder": [
