    ],
    "toleransMotAktivitetsbegransning": "Bedömd tolerans för samtliga fyra förmågor ligger på en relativt jämn och låg nivå. Individer som har begränsningar som ligger under eller på angivna nivåer torde normalt klara av arbetet utan omfattande anpassningar.",
    "fysiskaFunktioner": {
        "beskrivning": "Arbetssjukdomar orsakas vanligast av belastningsfaktorer som rörelser med belastning eller repetitivt arbete. Yrkesgruppen kan, enligt Arbetsmiljöverket, utveckla arbetssjukdomar på grund av tunga lyft.",
        "toleranser": [
            {
                "beskrivning": "Arbetsuppgifterna ställer krav på förmåga att stå och gå under större delen av arbetspasset. De präglas av fysisk aktivet men erbjuder varierade arbetsställningar. I de flesta yrkesinriktningarna utförs arbetet stående och gående vilket kräver god funktion i nedre extremiteter, mage och rygg för att kunna behålla en stående kroppsställning över tid. Arbetsuppgifterna kräver också en viss styrka och förmåga att arbeta med de övre extremiteterna för att kunna hantera tyngre arbetsmaterial som exempelvis disk. Krav ställs också på hand- och armstyrka samt förmåga att böja sig, vrida på kroppen och sträcka sig upprepat men oftast inte statiskt.",
                "min": 1,
                "max": 2
            },
            {
                "beskrivning": "Arbetsuppgifterna ställer krav på förmåga att stå och gå under större delen av arbetspasset. Arbetsuppgifterna präglas av fysisk aktivitet, men de erbjuder variation beträffande aktivitet och kroppsställning. Det finns arbeten där yrkesutövaren främst rör sig inom en mindre yta som hen ansvarar för, som exempelvis en bar, och arbeten där hen rör sig över större ytor.",
                "min": 1,
                "max": 2
            }
        ]
    },
    "synHorselTal": {
        "beskrivning": "Bartendrar utgör, enligt Arbetsmiljöverket, en högriskgrupp för att utveckla bullerrelaterade arbetssjukdomar.",
        "toleranser": [
            {
                "beskrivning": "Arbetet bedrivs ofta i miljö med dåligt ljus. Arbetsuppgifterna präglas i mycket hög grad av interaktion med andra vilket kräver god förmåga se framför allt på nära men i vissa fall även på långt håll. Det finns arbeten där yrkesutövaren främst rör sig inom en mindre yta som hen ansvarar för, som exempelvis en bar, och arbeten där hen rör sig över större ytor. Detta kan ha viss betydelse för toleransen avseende nedsatt syn.",
                "min": 1,
                "max": 1
            },
            {
                "beskrivning": "Arbetsuppgifterna utförs uteslutande genom interaktion med kunderna. Att kunna höra vad andra säger är således en central del i arbetet. Vanligt är att arbetsmiljön har höga ljudnivåer eller störande omgivningsljud och är hörselkrävande. I arbetet måste yrkesutövare kunna sortera och skilja olika ljud från varandra. Det kan röra sig om ljud från TV och musikanläggningar och bakgrundstal som ska skiljas från direkt tal till personalen. Det finns arbeten där yrkesutövaren främst rör sig inom en mindre yta som hen ansvarar för, som exempelvis en bar, och arbeten där hen rör sig över större ytor. Detta kan ha viss betydelse för toleransen avseende nedsatt hörsel.",
                "min": 1,
                "max": 1
            },
            {
                "beskrivning": "Arbetsuppgifterna präglas i mycket hög grad av interaktion med andra vilket kräver god förmåga att tala så att andra förstår.",
                "min": 1,
                "max": 1
            }
        ]
    },
    "balansKoordinationFinmotoriskKvalitet": {
        "beskrivning": "",
        "toleranser": [
            {
                "beskrivning": "Arbetsuppgifterna utförs i huvudsak med händer och armar och kräver bland annat stadighet vid exempelvis servering. Det krävs också god finmotorisk förmåga när yrkesutövare hanterar tallrikar, bestick och olika typer av ömtåliga, ofta heta och ibland blöta föremål. Balansförmåga och koordination är viktigt då denna typ av föremål förflyttas bland andra människor. Arbetet förutsätter också ett visst mått av finmotorisk kvalitet vad gäller att kunna presentera exempelvis drinkar på ett aptitligt och säljande sätt.",
                "min": 1,
                "max": 2
            }
        ]
    },
    "psykiskaFunktioner": {
        "beskrivning": "",
        "toleranser": [
            {
                "beskrivning": "Arbetet handlar till stor del om att kunna upprätthålla och fokusera uppmärksamhet och kognitiv närvaro i en bullrig arbetsmiljö över tid och ofta under stressiga förhållanden. Det ställs krav på att förstå vad andra säger och uttrycka sig så att andra förstår. Att kunna ha dialog med en eller flera kunder samtidigt som yrkesutövare utför sitt arbete med precision är vanligt förekommande. Det kan exempelvis finnas krav på att kunna lära in en meny, kunna diskutera och föreslå dryckesval och känna till specialkost och alternativ när det är aktuellt.",
                "min": 2,
                "max": 2
            },
            {
                "beskrivning": "Krav ställs på förmåga att genomföra arbetsuppgifterna i en ofta stressig miljö. Arbetet utförs dock i en strukturerad kontext med tydliga arbetsuppgifter, och ställer inte krav på avancerad problemlösning. Många arbeten innehåller försäljning av alkohol där yrkesutövare måste kunna förhålla sig till alkohollagens krav.",
                "min": 2,
                "max": 2
            },
            {
                "beskrivning": "Arbetsuppgifterna ställer höga krav på affektiv kontroll då arbetet i stor utsträckning består av social interaktion med kunder. Arbetet bygger i hög utsträckning på korta kundmöten där servicekänslan är avgörande. Arbetet är oftast mycket utåtriktat. Det är vanligt förekommande att det är ett genomgångsyrke med korta anställningstider för delar av personalen. Många har också tillfälliga anställningar och deltidsanställningar. En ostabil personalstruktur kan påverka personer med affektiv funktionsnedsättning negativt.",
                "min": 1,
                "max": 1
            },
            {
                "beskrivning": "Arbetet kräver normalt att yrkesutövare kan upprätthålla aktivitet och stabilitet under ett arbetspass i en ofta stressig och bullrig arbetsmiljö.",
                "min": 1,
                "max": 2
            }
        ]
    },
